<script>

var tdec=document.getElementById('ccaa');
tdec.innerHTML="<canvas width=500 height=500 id='canvasx' style='position:fixed;left:2%;top:2%;width:96%;height:96%;aopacity:.0366' ></canvas>";

var canxx=document.getElementById('canvasx');
var ctxx=canxx.getContext('2d');


function shuffle(a){ var j, x, i; for(i=a.length-1;i>0;i--){ 
j=Math.floor(Math.random()*(i+1)); x=a[i]; a[i]=a[j]; a[j]=x; } return a; 
}


    function fillCircle(c,x, y, radius, color) {

        c.fillStyle = color;

        c.beginPath();
        c.arc(x, y, radius, 0, 2 * Math.PI);
        c.fill();
    }



function plot(){
 tdec=document.getElementById('ccaa');
tdec.innerHTML="<canvas width=500 height=500 id='canvasx' style='position:fixed;left:2%;top:2%;width:96%;height:96%;aopacity:.0366' ></canvas>";
 canxx=document.getElementById('canvasx');
ctxx=canxx.getContext('2d');
ctxx.beginPath();

ctxx.fillStyle="transparent";
ctxx.fillRect(0,0,500,500);

str="";
d=new Date();
h=20;







for(hh=0;hh<h;hh++){
	fr2=Math.pow(1.1,Math.round((Math.random()*1)));
fr=fr2; //*Math.round(1+(1*Math.random()));	
fillCircle(ctxx,Math.round(Math.random()*500),Math.round(500*Math.random()) , Math.round((fr+fr2)/4),"#ffffff");
}

for(ff=0;ff<20;ff++){


t00=-5+Math.round(15*Math.random());
t01=-5+Math.round(15*Math.random());
t02=-5+Math.round(15*Math.random());

osas2=t00+50+Math.round(40*Math.random());
osas1=t01+40+Math.round(40*Math.random());
osas=t02+45+Math.round(40*Math.random());

col="rgba("+osas+","+osas2+","+osas1+",.0222)";
var x=new Array();

qst=15+Math.round(20*Math.random());
max=qst*2; 
change=qst;
x[0]=max/2;
op=new Array();
op[0]=(-change+(2*Math.random()*change));
for(i=1;i<max;i++){
p=(-change+(2*Math.random()*change));
x[i]=x[i-1]+p;
op[i]=p;
}


xx=x;
xs=shuffle(op);
maxx=Math.floor(max);
for(i=0;i<maxx;i++){
x[i+maxx]=x[i+maxx-1]+(-op[i]);
}


//x.sort(function(aNr, bNr){return aNr - bNr});

xw=max/2;
y=max/2;

bc=Math.round(1+(Math.random()));
left=Math.round(-(500/12))+Math.round(500/6*Math.random());
for(i=0;i<x.length;i++){
	xw=(500/2)+left+((max/2)*Math.cos(Math.PI*2*i/x.length));
	y=(500/3)+x[i]+((max/2)*Math.sin(Math.PI*2*bc*i/x.length));




fillCircle(ctxx,xw, y,  Math.round(20+(Math.random()*10)) ,col);


}






}





setTimeout("plot()", 17033);

}
plot();





</script>

        let currentIndex = 0;

        function showNextIframe() {
            // Hide all iframes and remove their src
            iframes.forEach(iframe => {
                document.getElementById(iframe.id).classList.remove('active');
                document.getElementById(iframe.id).src = 'about:blank';
            });

            // Show the next iframe and set its src
            const nextIframe = document.getElementById(iframes[currentIndex].id);
            nextIframe.src = iframes[currentIndex].src;
            nextIframe.classList.add('active');

            // Update the index
            currentIndex = toltel % iframes.length;
	    toltel+=1;
        }

        // Show the first iframe initially
        showNextIframe();

        // Rotate iframes every 5 seconds
        setInterval(showNextIframe, 20000);

<img id='haat'>
<script>
var on=1.5;
var hos=0;
var im=document.getElementById('haat');
im.src=haat;
im.style.left=(Math.round(screen.width/2)-456)+"px";
im.style.top=(Math.round(screen.height/2)-345)+"px";
im.style.position="fixed";


function doStep(){
x=(Math.round(screen.width/2)-456)-Math.round(on*1.6);
y=(Math.round(screen.height/2)-345)+Math.round(1.4*on)
if(x<-556 || y>(screen.height+256)){
on=1.5;
if((hos%2)==0){
im.src=haat;
}
else{
im.src=haat2;
}

hos++;
}
im.style.left=x+"px";
im.style.top=y+"px";
im.style.transform = "rotate("+ -(on % 360) +"deg)";

on=on*1.2;
setTimeout("doStep()", 80);
}
doStep();

</script>
